import Expenses from "./components/Expenses";
function App() {
  const expenses = [
    {
      title: "car insurance",
      amount: 342.55,
      date: new Date(2021, 2, 28),
    },
    {
      title: "toilet paper",
      amount: 245.7,
      date: new Date(2021, 8, 5),
    },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items={expenses}></Expenses>
    </div>
  );
}

export default App;
